import React, { Component } from 'react';
import Survey from '../Survey'
import Stats from '../Covit-19 Live Stats/Stats'
import About from '../About'
import {Route,Link,Switch,BrowserRouter as Router} from '../../../node_modules/react-router-dom'

class MyRouter extends Component {
    render() {
        return (
           
            <Router>
            <div>
            
       
        
              {/* A <Switch> looks through its children <Route>s and
                  renders the first one that matches the current URL. */}
              <Switch>
                <Route path="/about"> <About /> </Route>
                <Route path="/survey"> <Survey /> </Route>
                <Route path="/stats" component={Stats}>  <Stats /></Route>
                
              </Switch>
            </div>
          </Router>

        );
    }
}

export default MyRouter;
